import React from 'react';
import SplitPane from 'react-split-pane';
import './App.css';
import './styles/styles.css'

function App() {
  return (
    <div className="App">
      <SplitPane
      split='vertical'
      defaultSize='45%'
      minSize='10%'
      >
        <div class="left"></div>
        <SplitPane
        split='horizontal'
        defaultSize='65%'
        >
          <div class="upper">

          </div>
          <div class="lower">

          </div>
        </SplitPane>
      </SplitPane>
    </div>
  );
}

export default App;
